import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Define the XSS payload
    const xssPayload = "<script>alert('XSS')</script>";

    // Locate the search input field using its placeholder attribute
    const searchInput = page.getByPlaceholder('Search Amazon');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });

    // Fill the search input with the XSS payload
    await searchInput.fill(xssPayload);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_payload_entered.png'));

    // Locate and click the search button
    // Using the first element with class 'search-btn'
    const searchButton = page.locator('.search-btn').first();
    await searchButton.waitFor({ state: 'visible', timeout: 5000 });
    await searchButton.click();

    // Take a final screenshot after submitting the search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_submit.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_submit.png'));

    // Extract the value from the input to verify the action
    const enteredValue = await searchInput.inputValue();

    return {
      success: true,
      action: "Attempted XSS by entering a script payload into the search input and submitting.",
      extractedData: {
        payloadUsed: xssPayload,
        valueInInput: enteredValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to attempt XSS via search input",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
